// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Import the Chainlink interface
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract priceOracle {
    // Declare the Chainlink aggregator variable
    AggregatorV3Interface internal priceFeed;

    // Constructor to initialize the Chainlink aggregator contract address
    constructor () {
        // Replace the address below with the actual Chainlink aggregator address for the desired price feed (e.g., ETH/USD)
        priceFeed = AggregatorV3Interface(0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419);
    }

    // Event to log price data
    event PriceLog(
        int price,
        uint80 roundID,
        uint startedAt,
        uint timeStamp,
        uint80 answeredInRound
    );

    // Function to get the latest price from the Chainlink aggregator
    function getLatestPrice() public returns (int) {
        (
            uint80 roundID,
            int price,
            uint startedAt,
            uint timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();

        emit PriceLog(price, roundID, startedAt, timeStamp, answeredInRound);

        return price / 1e8;
    }
}
